import axios from "axios";

const BASE_URL = "https://fakestoreapi.com";

const getProducts = async () => {
  const response = await axios
    .get(`${BASE_URL}/products`)
    .catch((err) => console.log(response.data));
  return response.data;
};

export { getProducts };
